import React from "react";
import { NavLink } from "react-router-dom";
import "../styles_css/Menu.css";

const Menu = () => {
  return (
    <ul className="custom-menu">
      <li className="menu-item">
        <NavLink
          to="/"
          className={({ isActive }) => (isActive ? "active" : "")}
        >
          <span>Home</span>
        </NavLink>
      </li>
      <li className="menu-item">
        <NavLink
          to="/services"
          className={({ isActive }) => (isActive ? "active" : "")}
        >
          <span>Services</span>
        </NavLink>
      </li>
      <li className="menu-item">
        <NavLink
          to="/empowering"
          className={({ isActive }) => (isActive ? "active" : "")}
        >
          <span>Empowering</span>
        </NavLink>
      </li>
      <li className="menu-item">
        <NavLink
          to="/about"
          className={({ isActive }) => (isActive ? "active" : "")}
        >
          <span>About</span>
        </NavLink>
      </li>
      <li className="menu-item">
        <NavLink
          to="/contact"
          className={({ isActive }) => (isActive ? "active" : "")}
        >
          <span>Contact</span>
        </NavLink>
      </li>
    </ul>
  );
};

export default Menu;
